eb browsers became more advanced, mobile devices became ubiquitous, and companies no longer required dedicated servers.&amp;lt;/font&amp;gt;&amp;lt;/span&amp;gt;&amp;lt;/p&amp;gt;&amp;lt;p&amp;gt;&amp;lt;font style=&amp;quot;font-size: 15px;&amp;quot;&amp;gt;As a full stack software engineer, I have had the privilege to work on technologies ranging from mainframes, custom built hardware from the 1980s, communications with satellites in space to data communication over Wide Area Networks. C, C++, and Java were the main drivers for this experience to include some FORTRAN and IBM Assembly 370. Also had the privilege to work on embedded systems utilizing different real-time operating systems as part of this wider communication systems experience.&amp;lt;/font&amp;gt;&amp;lt;/p&amp;gt;&amp;lt;p&amp;gt;&amp;lt;font style=&amp;quot;font-size: 15px;&amp;quot;&amp;gt;Then came the secondary part of my career entering the commercial world. My full stack experience needed to evolve as no longer was Java enough. Instead of dedicated backend servers, there are now cloud services and the web made the ultimate runtime environment for reaching customers. As long as a device has a browser, the user can reach your app. While professionally my work has been in mobile app development, the technologies I learned on the way has led to learning other technologies for fulfilling my passion to deliver the greatest reach to customers for software engineers.&amp;amp;nbsp;&amp;lt;/font&amp;gt;&amp;lt;/p&amp;gt;&amp;lt;p&amp;gt;&amp;lt;font style=&amp;quot;font-size: 15px;&amp;quot;&amp;gt;Enter the CodeMelted DEV project. The aim of this project is to deliver usable modules to aid software engineers for building full stack solutions for their applications. It will also serve as a learning tool providing a Rosetta stone between the chosen programming languages. The Rosetta stone translation will serve a language specific implementations of the 14 chosen use cases (page 2) that all software engineers should be familiar.&amp;amp;nbsp;&amp;lt;/font&amp;gt;&amp;lt;/p&amp;gt;&amp;lt;p style=&amp;quot;text-align: center;&amp;quot;&amp;gt;THE 14 USE CASE SERVE AS THE 1.0.0 RELEASE FOR THE MODULES&amp;lt;/p&amp;gt;\&quot; style=\&quot;text;html=1;whiteSpace=wrap;overflow=hidden;rounded=0;\&quot; parent=\&quot;1\&quot; vertex=\&quot;1\&quot;&gt;&lt;mxGeometry x=\&quot;0.01\&quot; width=\&quot;1099.99\&quot; height=\&quot;390\&quot; as=\&quot;geometry\&quot;/&gt;&lt;/mxCell&gt;&lt;mxCell id=\&quot;C076osA66eF6QDK0PcJW-1\&quot; value=\&quot;Flutter Web\&quot; style=\&quot;swimlane;horizontal=0;whiteSpace=wrap;html=1;startSize=23;fillColor=#d5e8d4;strokeColor=#82b366;gradientColor=#97d077;container=0;\&quot; parent=\&quot;1\&quot; vertex=\&quot;1\&quot;&gt;&lt;mxGeometry y=\&quot;404\&quot; width=\&quot;1050\&quot; height=\&quot;85\&quot; as=\&quot;geometry\&quot;/&gt;&lt;/mxCell&gt;&lt;mxCell id=\&quot;e53c2hWD8A9QC_uXUgJi-1\&quot; value=\&quot;\&quot; style=\&quot;shape=image;verticalLabelPosition=bottom;labelBackgroundColor=default;verticalAlign=top;aspect=fixed;imageAspect=0;image=data:image/png,iVBORw0KGgoAAAANSUhEUgAAAJAAAACQCAYAAADnRuK4AAAACXBIWXMAAAsTAAALEwEAmpwYAAAD4klEQVR4nO3ay04UURCAYei5ACPKu2gMrn0BfANREcJdZkZ7eVz6HmpiJEYlJIooiKjclDFxw8YEF8PCnTt3ZYYMC024Fd19Lv1/ST1A1fnTmaAdHQAAAAAAAAAAAABybaAp96/tiTg0xvZNcELEAzXigRrxQI14oEY8UCMeqBEP1IgHasQDNeKBGvFAjXigRjxQIx6oEQ/UiAdqxAM14oEa8UCNeKBGPFAjHqgRD9SIB2rEAzXigRrxQI14oEY8UCMeqBEP1IgHasQDNeKBGvFAjXigRjxQIx6oEQ/UiAdqxAM14oEa8UCNeKBGPFAjHqgRD9SIB2rEAzXigRrxQI14oEY8UAs1nlD3ckqoRw51L6eEeuRQ93JKqEcOdS+nhHrkUPdySqhHDnUv5ww0JXbguMTjM0ci4svjM8sREU8ILEVEPCHJOCLiCVFGERFPyFKOiHjyIKWIiCdPEo6IePIooYgSiad/sbl79fufrH7kS1Z7Be+MESUWz+WV39IaRyIySeyVG8qIEo/HkYhMEnvlzikjSi0eyxGZJPbKrRNGlHo8liIySeyVe8dElFk8GUdkcv/wGUSUeTwZRWSS2AtHR2QtnpQjMjx8ilr/+681tuNJKSKTxF7IQBLxJByR4eFzGE9CERnbN4HFeM4YkeHxPJFmPMqIjO2bwKF4ThmR4fE8kWU8J4zI2L4JHI7nmIgMj+cJm/EcEpGxfRN4FM9/ERkezyP9b5o7tsM5mIsvd6Xv+sMHtm8CDyPaj2fwkVy48UTO33pKRL6xGdG/8cxK79AzOXf7BRH5xkZE r specific code to take full advantage of the widget toolkit and Flutter native code that can be utilized within the web. The remaining use case functionality will take advantage of Flutter&#39;s bindings with the JavaScript browser APIs.\&quot; style=\&quot;text;html=1;align=left;verticalAlign=middle;whiteSpace=wrap;rounded=0;fontSize=15;\&quot; parent=\&quot;1\&quot; vertex=\&quot;1\&quot;&gt;&lt;mxGeometry x=\&quot;100\&quot; y=\&quot;404\&quot; width=\&quot;940\&quot; height=\&quot;85\&quot; as=\&quot;geometry\&quot;/&gt;&lt;/mxCell&gt;&lt;mxCell id=\&quot;1Ya8_Bt4qvLnaT3x2F8C-10\&quot; value=\&quot;The codemelted.js module will be an ES6 module that supports its usage within Deno / NodeJS V8 runtimes for backend services along with Web browsers to support regular HTML / CSS / JS Single Page Application (SPA) development. The module will make heavy usage of JSDoc typing to ensure it works with available TypeScript type checkers within a software engineers chosen development platform. This module serves as the one that can provide a singular language for the full stack solution. The others provide enhancements where this may not be applicable.&amp;amp;nbsp;&amp;amp;nbsp;\&quot; style=\&quot;text;html=1;align=left;verticalAlign=middle;whiteSpace=wrap;rounded=0;fontSize=15;\&quot; parent=\&quot;1\&quot; vertex=\&quot;1\&quot;&gt;&lt;mxGeometry x=\&quot;100\&quot; y=\&quot;489\&quot; width=\&quot;940\&quot; height=\&quot;95\&quot; as=\&quot;geometry\&quot;/&gt;&lt;/mxCell&gt;&lt;mxCell id=\&quot;vT0f5g9XgUe2GUfTTs0C-1\&quot; value=\&quot;\&quot; style=\&quot;group\&quot; parent=\&quot;1\&quot; vertex=\&quot;1\&quot; connectable=\&quot;0\&quot;&gt;&lt;mxGeometry y=\&quot;669\&quot; width=\&quot;1050\&quot; height=\&quot;70\&quot; as=\&quot;geometry\&quot;/&gt;&lt;/mxCell&gt;&lt;mxCell id=\&quot;1Ya8_Bt4qvLnaT3x2F8C-1\&quot; value=\&quot;Rust\&quot; style=\&quot;swimlane;horizontal=0;whiteSpace=wrap;html=1;fillColor=#d5e8d4;strokeColor=#82b366;gradientColor=#97d077;container=0;\&quot; parent=\&quot;vT0f5g9XgUe2GUfTTs0C-1\&quot; vertex=\&quot;1\&quot;&gt;&lt;mxGeometry width=\&quot;1050\&quot; height=\&quot;70\&quot; as=\&quot;geometry\&quot;/&gt;&lt;/mxCell&gt;&lt;mxCell id=\&quot;1Ya8_Bt4qvLnaT3x2F8C-12\&quot; value=\&quot;The codemelted.rs module will be an installable crate that provides the full native speed of a C/C++ application but with modern language constructs and memory safety. While C/C++ still have their place in application development, memory safety proves to be the #1 attack vector of hackers. Rust was designed to address those shortcomings and is an ideal choice for new developers.&amp;amp;nbsp;\&quot; style=\&quot;text;html=1;align=left;verticalAlign=middle;whiteSpace=wrap;rounded=0;fontSize=15;\&quot; parent=\&quot;1Ya8_Bt4qvLnaT3x2F8C-1\&quot; vertex=\&quot;1\&quot;&gt;&lt;mxGeometry x=\&quot;98.46\&quot; width=\&quot;941.54\&quot; height=\&quot;70\&quot; as=\&quot;geometry\&quot;/&gt;&lt;/mxCell&gt;&lt;mxCell id=\&quot;Af-twK92lzilVPGF3vt6-1\&quot; value=\&quot;\&quot; style=\&quot;shape=image;verticalLabelPosition=bottom;labelBackgroundColor=default;verticalAlign=top;aspect=fixed;imageAspect=0;image=data:image/png,iVBORw0KGgoAAAANSUhEUgAAAQAAAAEACAYAAABccqhmAACDNklEQVR4AezaAWodWXYG4O/cqnpq9aSJlqABAIAQFAgEEmDcCwitIQABArFX0N0r6CYAgQDpDARIAqDOCjpZgTsraO9gvIMxzEzbelX3nCR+hSRZ2FieZDC4PricKgEPntD57ynVtdlsPlxh88H6t0d/fubgic0HKf7nj8Dmw9IuL8/y6Og74tTBM3yJb31QNiPhQ7I1//PTmnaPcUJZneACT/G9zQdjpGzey136YR599LcQy/ws+vKL/4vmzN3RhYgTq+hdLIsamhqnC/zU7+6U+OpQwX/ha5ttAti81S79Db6gQFTCOR79LmN6cN6W5UFNE4hMscxXQZDjdIqv1/VOijM8pk5ce4Cf4VObbQLYvNFp7o6+gMhUrb1cAVxowzP8h3uqYTiJ/f4isrNQ40Rf3JJJa18V3+Kpe4szan28uOMBHuJb743N6L2yaX35vIZRzLPITmuqDUSoYSTiIrI/xRP3UFVfJSeqVB5Wy1RVrDKCKjHPF/fdrWu3O4vXNz8C9dkbA2CzBcAmzqN3kR3IFJkINQac4HGVT982BPaX+wc1jF9EFUkp9rPY7xGgxpEfn4ve4QH19rv18U9OWtZFRJxARLz2u+EUT70XNvGvj/7C+2EzXj4/x3deka2pYVSoTJWlqp6ltwuB/tvf/oCzaqMaRlCISqpUayB6F31xEM/6OP0Uz7xBG9tJa+1xRJxFBEEIEYclwqEEQoQv8U822wSwueOzKihZpYocJplULipL7F+sAeCk he functionality to work with and manage files on a hard disk.&amp;lt;/font&amp;gt;&amp;lt;/li&amp;gt;&amp;lt;li&amp;gt;&amp;lt;font&amp;gt;&amp;lt;b&amp;gt;HW:&amp;lt;/b&amp;gt;&amp;amp;nbsp;Will provide the mechanisms to interact with hardware peripherals via BLE, RS-232 Serial, or USB connected to a system.&amp;amp;nbsp;&amp;lt;/font&amp;gt;&amp;lt;/li&amp;gt;&amp;lt;li&amp;gt;&amp;lt;font&amp;gt;&amp;lt;b&amp;gt;JSON:&amp;lt;/b&amp;gt;&amp;amp;nbsp;JSON is the most common data format to work with for web technologies. This will provide all the mechanisms necessary to work with this data.&amp;lt;/font&amp;gt;&amp;lt;/li&amp;gt;&amp;lt;li&amp;gt;&amp;lt;font&amp;gt;&amp;lt;b&amp;gt;Logger: &amp;lt;/b&amp;gt;Provides a simple logging facility to log to STDOUT along with hookup a log handler for further processing in production.&amp;lt;/font&amp;gt;&amp;lt;/li&amp;gt;&amp;lt;li&amp;gt;&amp;lt;font&amp;gt;&amp;lt;b&amp;gt;Monitor:&amp;lt;/b&amp;gt;&amp;amp;nbsp;Mainly for the backend modules, provides the queries for getting different platform statistics so good monitoring can be achieved.&amp;lt;/font&amp;gt;&amp;lt;/li&amp;gt;&amp;lt;li&amp;gt;&amp;lt;font&amp;gt;&amp;lt;b&amp;gt;Network:&amp;lt;/b&amp;gt;&amp;amp;nbsp;The Internet is how apps communicate. This will provide access to web technologies to facilitate this communication.&amp;lt;/font&amp;gt;&amp;lt;/li&amp;gt;&amp;lt;li&amp;gt;&amp;lt;font&amp;gt;&amp;lt;b&amp;gt;NPU:&amp;lt;/b&amp;gt;&amp;amp;nbsp;Stands for Numeric Processing Unit, this will be where all the math is at. Applications need to crunch numbers. This will provide that functionality.&amp;lt;/font&amp;gt;&amp;lt;/li&amp;gt;&amp;lt;li&amp;gt;&amp;lt;font&amp;gt;&amp;lt;b&amp;gt;Runtime:&amp;lt;/b&amp;gt;&amp;amp;nbsp;Unique to each SDK technology this will provide access to runtime services specific to that SDK.&amp;lt;/font&amp;gt;&amp;lt;/li&amp;gt;&amp;lt;li&amp;gt;&amp;lt;font&amp;gt;&amp;lt;b&amp;gt;Storage:&amp;lt;/b&amp;gt;&amp;amp;nbs &amp;quot;margin-top: 0px;&amp;quot;&amp;gt;Description&amp;lt;/h1&amp;gt;&amp;lt;p&amp;gt;According to Wikipedia, &amp;quot;a thread of execution is the smallest sequence of programmed instructions that can be managed independently by a scheduler, which is typically a part of the operating system. In many cases, a thread is a component of a process.&amp;quot; What this is stating is that two sets of synchronous execution can occur in parallel. This can be accomplished in two forms with many programming languages, a supported thread constructs for the given language or communicating with other operating system processes (typically another program / service).&amp;lt;/p&amp;gt;&amp;lt;p&amp;gt;According to MDN, &amp;quot;Asynchronous software design expands upon the concept by building code that allows a program to ask that a task be performed alongside the original task (or tasks), without stopping to wait for the task to complete. When the secondary task is completed, the original task is notified using an agreed-upon mechanism so that it knows the work is done, and that the result, if any, is available.&amp;quot; This basically means the ability to not run code in parallel but instead time slice a main thread to run different tasks where the notification on one task completing kicks off another work task.&amp;lt;/p&amp;gt;&amp;lt;p&amp;gt;The Async Use Case will implement both concepts playing to the overall strengths of each programming language SDK.&amp;lt;/p&amp;gt;\&quot; style=\&quot;text;html=1;whiteSpace=wrap;overflow=hidden;rounded=0;\&quot; vertex=\&quot;1\&quot; parent=\&quot;1\&quot;&gt;&lt;mxGeometry width=\&quot;830\&quot; height=\&quot;210\&quot; as=\&quot;geometry\&quot;/&gt;&lt;/mxCell&gt;&lt;mxCell id=\&quot;0F9bExwt8V03-dSukulw-1\&quot; value=\&quot;&amp;lt;h1 style=&amp;quot;margin-top: 0px;&amp;quot;&amp;gt;Acceptance Criteria&amp;lt;/h1&amp;gt;&amp;lt;p&amp;gt;&amp;lt;/p&amp;gt;&amp;lt;ol&amp;gt;&amp;lt;li&amp;gt;The Async Use Case will support the ability to kickoff and communicate with other computer processes via STDIN / STDOUT.&amp;lt;/li&amp;gt;&amp;lt;li&amp;gt;The Async Use Case will support the ability to sleep a given task in milliseconds.&amp;lt;/li&amp;gt;&amp;lt;li&amp;gt;The Async Use Case will support the scheduling of a task that can take data (if required) and run to completion returning a result (if required).&amp;amp;nbsp; For Flutter / JavaScript this is on the same thread via Promises. For PowerShell and Rust, this is in a background thread.&amp;lt;/li&amp;gt;&amp;lt;li&amp;gt;The Async Use Case will support the starting of a timer that repeats a specified task on a regular interval until stopped. For Flutter / JavaScript this is on the same thread via Promises. For PowerShell and Rust, this is in a background thread.&amp;lt;/li&amp;gt;&amp;lt;li&amp;gt;The Async Use Case will support the ability to start a background worker that has the ability to queue up work tasks in a first in first out (FIFO) order and receive the results of the completed tasks.&amp;lt;/li&amp;gt;&amp;lt;li&amp;gt;For PowerShell Only. The Async Use Case will support the ability to list operating system processes and kill a specified running process. This only works if you have the appropriate permissions.&amp;lt;/li&amp;gt;&amp;lt;/ol&amp;gt;&amp;lt;p&amp;gt;&amp;lt;/p&amp;gt;\&quot; style=\&quot;text;html=1;whiteSpace=wrap;overflow=hidden;rounded=0;\&quot; vertex=\&quot;1\&quot; parent=\&quot;1\&quot;&gt;&lt;mxGeometry y=\&quot;210\&quot; width=\&quot;830\&quot; height=\&quot;210\&quot; as=\&quot;geometry\&quot;/&gt;&lt;/mxCell&gt;&lt;mxCell id=\&quot;DyJbszaPeIyF65o1S3Km-1\&quot; value=\&quot;&amp;lt;h1 style=&amp;quot;margin-top: 0px;&amp;quot;&amp;gt;Properties&amp;lt;/h1&amp;gt;&amp;lt;p&amp;gt;&amp;lt;/p&amp;gt;&amp;lt;ul&amp;gt;&amp;lt;li&amp;gt;&amp;lt;u&amp;gt;CPU Count:&amp;lt;/u&amp;gt;&amp;amp;nbsp;The number of CPUs that can support background tasks.&amp;amp;nbsp;&amp;lt;/li&amp;gt;&amp;lt;/ul&amp;gt;&amp;lt;p&amp;gt;&amp;lt;/p&amp;gt;\&quot; style=\&quot;text;html=1;whiteSpace=wrap;overflow=hidden;rounded=0;\&quot; vertex=\&quot;1\&quot; parent=\&quot;1\&quot;&gt;&lt;mxGeometry x=\&quot;840\&quot; width=\&quot;254\&quot; height=\&quot;80\&quot; as=\&quot;geometry\&quot;/&gt;&lt;/mxCell&gt;&lt;mxCell id=\&quot;5mh1s3FEoaVXftsUEk_y-1\&quot; value=\&quot;\&quot; style=\&quot;group\&quot; vertex=\&quot;1\&quot; connectable=\&quot;0\&quot; parent=\&quot;1\&quot;&gt;&lt;mxGeometry x=\&quot;840\&quot; y=\&quot;90\&quot; width=\&quot;260\&quot; height=\&quot;81\&quot; as=\&quot;geometry\&quot;/&gt;&lt;/mxCell&gt;&lt;mxCell id=\&quot;5mh1s3FEoaVXftsUEk_y-2\&quot; value=\&quot;&amp;lt;h1 style=&amp;quot;margin-top: 0px;&amp;quot;&amp;gt;Applies To&amp;lt;/h1&amp;gt;&amp;lt;p&amp;gt;&amp;lt;br&amp;gt;&amp;lt;/p&amp;gt;\&quot; style=\&quot;text;html=1;whiteSpace=wrap;overflow=hidden;rounded=0;\&quot; vertex=\&quot;1\&quot; parent=\&quot;5mh1s3FEoaVXftsUEk_y-1\&quot;&gt;&lt;mxGeometry width=\&quot;260\&quot; height=\&quot;81\&quot; as=\&quot;geometry\&quot;/&gt;&lt;/mxCell&gt;&lt;mxCell id=\&quot;5mh1s3FEoaVXftsUEk_y-3\&quot; value=\&quot;\&quot; style=\&quot;shape=image;verticalLabelPosition=bottom;labelBackgroundColor=default;verticalAlign=top;aspect=fixed;imageAspect=0;image=data:image/png,iVBORw0KGgoAAAANSUhEUgAAAJAAAACQCAYAAADnRuK4AAAACXBIWXMAAAsTAAALEwEAmpwYAAAD4klEQVR4nO3ay04UURCAYei5ACPKu2gMrn0BfANREcJdZkZ7eVz6HmpiJEYlJIooiKjclDFxw8YEF8PCnTt3ZYYMC024Fd19Lv1/ST1A1fnTmaAdHQAAAAAAAAAAAABybaAp96/tiTg0xvZNcELEAzXigRrxQI14oEY8UCMeqBEP1IgHasQDNeKBGvFAjXigRjxQIx6oEQ/UiAdqxAM14oEa8UCNeKBGPFAjHqgRD9SIB2rEAzXigRrxQI14oEY8UCMeqBEP1IgHasQDNeKBGvFAjXigRjxQIx6oEQ/UiAdqxAM14oEa8UCNeKBGPFAjHqgRD9SIB2rEAzXigRrxQI14oEY8UAs1nlD3ckqoRw51L6eEeuRQ93JKqEcOdS+nhHrkUPdySqhHDnUv5ww0JXbguMTjM0ci4svjM8sREU8ILEVEPCHJOCLiCVFGERFPyFKOiHjyIKWIiCdPEo6IePIooYgSiad/sbl79fufrH7kS1Z7Be+MESUWz+WV39IaRyIySeyVG8qIEo/HkYhMEnvlzikjSi0eyxGZJPbKrRNGlHo8liIySeyVe8dElFk8GUdkcv/wGUSUeTwZRWSS2AtHR2QtnpQjMjx8ilr/+ t;&lt;mxGeometry x=\&quot;1022.3529411764706\&quot; y=\&quot;6\&quot; width=\&quot;77.64705882352942\&quot; height=\&quot;40\&quot; as=\&quot;geometry\&quot;/&gt;&lt;/mxCell&gt;&lt;mxCell id=\&quot;ygUultB5_LYM3AFgeVMt-0\&quot; value=\&quot;&amp;lt;h1 style=&amp;quot;margin-top: 0px;&amp;quot;&amp;gt;Description&amp;lt;/h1&amp;gt;&amp;lt;p&amp;gt;According to Mozilla, &amp;quot;&amp;lt;span style=&amp;quot;background-color: transparent;&amp;quot;&amp;gt;A progressive web app (PWA) is an app that&#39;s built using web platform technologies, but that provides a user experience like that of a platform-specific app.&amp;amp;nbsp;&amp;lt;/span&amp;gt;&amp;lt;span style=&amp;quot;background-color: transparent; color: light-dark(rgb(0, 0, 0), rgb(255, 255, 255));&amp;quot;&amp;gt;Like a website, a PWA can run on multiple platforms and devices from a single codebase. Like a platform-specific app, it can be installed on the device, can operate while offline and in the background, and can integrate with the device and with other installed apps.&amp;quot; Part of these web technologies is the ability to play audio files and perform text to speech (TTS).&amp;lt;/span&amp;gt;&amp;lt;/p&amp;gt;&amp;lt;p&amp;gt;&amp;lt;span style=&amp;quot;background-color: transparent; color: light-dark(rgb(0, 0, 0), rgb(255, 255, 255));&amp;quot;&amp;gt;The Audio Use Case will expose these capabilities via a constructed audio player object. It will be constructed with the specific resource along with initial audio properties configured. The end result of this audio player is the ability to loop, play, pause, and stop the resource. Along the way you will also be able to tweak the given audio properties.&amp;lt;/span&amp;gt;&amp;lt;/p&amp;gt;\&quot; style=\&quot;text;html=1;whiteSpace=wrap;overflow=hidden;rounded=0;\&quot; vertex=\&quot;1\&quot; parent=\&quot;6WX4eAYmd-eVY9AUPk49-1\&quot;&gt;&lt;mxGeometry width=\&quot;830\&quot; height=\&quot;170\&quot; as=\&quot;geometry\&quot;/&gt;&lt;/mxCell&gt;&lt;mxCell id=\&quot;bLhbQrm1p23mNh3QjxgM-0\&quot; value=\&quot;&amp;lt;h1 style=&amp;quot;margin-top: 0px;&amp;quot;&amp;gt;Acceptance Criteria&amp;lt;/h1&amp;gt;&amp;lt;p&amp;gt;&amp;lt;/p&amp;gt;&amp;lt;ol&amp;gt;&amp;lt;li&amp;gt;The Audio Use Case will construct an audio player from a string to provide the ability to perform TTS.&amp;lt;/li&amp;gt;&amp;lt;li&amp;gt;The Audio Use Case will construct an audio player from an audio resource (MP3, etc.) to begin playing sound.&amp;lt;/li&amp;gt;&amp;lt;li&amp;gt;The Audio Use Case audio player will support the controls of loop, play, pause, and stop.&amp;lt;/li&amp;gt;&amp;lt;li&amp;gt;The Audio Use Case audio player will support registering an event listener for state changes and any encountered errors.&amp;lt;/li&amp;gt;&amp;lt;li&amp;gt;The Audio Use Case audio player will support the pitch, rate, and volume properties.&amp;lt;/li&amp;gt;&amp;lt;/ol&amp;gt;&amp;lt;p&amp;gt;&amp;lt;/p&amp;gt;\&quot; style=\&quot;text;html=1;whiteSpace=wrap;overflow=hidden;rounded=0;\&quot; vertex=\&quot;1\&quot; parent=\&quot;6WX4eAYmd-eVY9AUPk49-1\&quot;&gt;&lt;mxGeometry y=\&quot;171\&quot; width=\&quot;830\&quot; height=\&quot;139\&quot; as=\&quot;geometry\&quot;/&gt;&lt;/mxCell&gt;&lt;mxCell id=\&quot;RO3HzcRP_KU9cKg0V5qo-0\&quot; value=\&quot;&amp;lt;h1 style=&amp;quot;margin-top: 0px;&amp;quot;&amp;gt;Properties&amp;lt;/h1&amp;gt;&amp;lt;p&amp;gt;&amp;lt;/p&amp;gt;&amp;lt;ul&amp;gt;&amp;lt;li&amp;gt;None&amp;lt;/li&amp;gt;&amp;lt;/ul&amp;gt;&amp;lt;p&amp;gt;&amp;lt;/p&amp;gt;\&quot; style=\&quot;text;html=1;whiteSpace=wrap;overflow=hidden;rounded=0;\&quot; vertex=\&quot;1\&quot; parent=\&quot;6WX4eAYmd-eVY9AUPk49-1\&quot;&gt;&lt;mxGeometry x=\&quot;840\&quot; width=\&quot;254\&quot; height=\&quot;80\&quot; as=\&quot;geometry\&quot;/&gt;&lt;/mxCell&gt;&lt;mxCell id=\&quot;RO3HzcRP_KU9cKg0V5qo-1\&quot; value=\&quot;\&quot; style=\&quot;group\&quot; vertex=\&quot;1\&quot; connectable=\&quot;0\&quot; parent=\&quot;6WX4eAYmd-eV QmCC;fontSize=10;\&quot; vertex=\&quot;1\&quot; parent=\&quot;12nXVf-p91hEBukGwvAY-0\&quot;&gt;&lt;mxGeometry x=\&quot;61.17647058823529\&quot; y=\&quot;36\&quot; width=\&quot;40\&quot; height=\&quot;40\&quot; as=\&quot;geometry\&quot;/&gt;&lt;/mxCell&gt;&lt;mxCell id=\&quot;AeZsujJWKxi-5T-NB9ur-5\&quot; value=\&quot;\&quot; style=\&quot;group\&quot; parent=\&quot;AeZsujJWKxi-5T-NB9ur-1\&quot; vertex=\&quot;1\&quot; connectable=\&quot;0\&quot;&gt;&lt;mxGeometry y=\&quot;801\&quot; width=\&quot;1100\&quot; height=\&quot;46\&quot; as=\&quot;geometry\&quot;/&gt;&lt;/mxCell&gt;&lt;mxCell id=\&quot;AeZsujJWKxi-5T-NB9ur-6\&quot; value=\&quot;\&quot; style=\&quot;endArrow=none;html=1;rounded=0;exitX=0;exitY=1;exitDx=0;exitDy=0;\&quot; parent=\&quot;AeZsujJWKxi-5T-NB9ur-5\&quot; edge=\&quot;1\&quot;&gt;&lt;mxGeometry width=\&quot;50\&quot; height=\&quot;50\&quot; relative=\&quot;1\&quot; as=\&quot;geometry\&quot;&gt;&lt;mxPoint x=\&quot;5.176470588235588\&quot; as=\&quot;sourcePoint\&quot;/&gt;&lt;mxPoint x=\&quot;1092.2352941176468\&quot; as=\&quot;targetPoint\&quot;/&gt;&lt;/mxGeometry&gt;&lt;/mxCell&gt;&lt;mxCell id=\&quot;AeZsujJWKxi-5T-NB9ur-7\&quot; value=\&quot;\&quot; style=\&quot;shape=image;verticalLabelPosition=bottom;labelBackgroundColor=default;verticalAlign=top;aspect=fixed;imageAspect=0;image=https://codemelted.com/assets/images/logo-codemelted-developer.png;\&quot; parent=\&quot;AeZsujJWKxi-5T-NB9ur-5\&quot; vertex=\&quot;1\&quot;&gt;&lt;mxGeometry x=\&quot;2.588235294117647\&quot; y=\&quot;6\&quot; width=\&quot;141.78861788617888\&quot; height=\&quot;35.44715447154472\&quot; as=\&quot;geometry\&quot;/&gt;&lt;/mxCell&gt;&lt;mxCell id=\&quot;AeZsujJWKxi-5T-NB9ur-8\&quot; value=\&quot;Console Use Case\&quot; style=\&quot;text;html=1;align=center;verticalAlign=middle;whiteSpace=wrap;rounded=0;fontStyle=1\&quot; parent=\&quot;AeZsujJWKxi-5T-NB9ur-5\&quot; vertex=\&quot;1\&quot;&gt;&lt;mxGeometry y=\&quot;6\&quot; width=\&quot;1100\&quot; height=\&quot;40\&quot; as=\&quot;geometry\&quot;/&gt;&lt;/mxCell&gt;&lt;mxCell id=\&quot;AeZsujJWKxi-5T-NB9ur-9\&quot; value=\&quot;&amp;amp;nbsp;5 / 16\&quot; style=\&quot;text;html=1;align=center;verticalAlign=middle;whiteSpace=wrap;rounded=0;fontStyle=1\&quot; parent=\&quot;AeZsujJWKxi-5T-NB9ur-5\&quot; vertex=\&quot;1\&quot;&gt;&lt;mxGeometry x=\&quot;1022.3529411764706\&quot; y=\&quot;6\&quot; width=\&quot;77.64705882352942\&quot; height=\&quot;40\&quot; as=\&quot;geometry\&quot;/&gt;&lt;/mxCell&gt;&lt;mxCell id=\&quot;RE9Lk4_TYkJp_x0fM5Pu-0\&quot; value=\&quot;&amp;lt;h1 style=&amp;quot;margin-top: 0px;&amp;quot;&amp;gt;Description&amp;lt;/h1&amp;gt;&amp;lt;p&amp;gt;The console as described by Microsoft, &amp;quot;is an operating system window where users interact with the operating system or with a text-based console application by entering text input through the computer keyboard, and by reading text output from the computer terminal.&amp;quot; Mainly it represents a user interacting with a console application via a terminal shell. Once executing the console-based application, the user will be prompted / informed via STDOUT and enter data via keyboard STDIN. Closure of the console application is either via prompt or a &amp;amp;lt;ctrl-c&amp;amp;gt; keystroke.&amp;amp;nbsp;&amp;lt;/p&amp;gt;&amp;lt;p&amp;gt;&amp;lt;i&amp;gt;NOTE: In this context, the console application is an interactive application via STDIN / STDOUT. It is not a dedicated Textual User Interface (TUI) or a shell command where the interaction while still via the terminal shell, is kicked off with arguments passed, and completes its work bringing the user back to the shell prompt.&amp;lt;/i&amp;gt;&amp;lt;/p&amp;gt;\&quot; style=\&quot;text;html=1;whiteSpace=wrap;overflow=hidden;rounded=0;\&quot; vertex=\&quot;1\&quot; parent=\&quot;AeZsujJWKxi-5T-NB9ur-1\&quot;&gt;&lt;mxGeometry width=\&quot;830\&quot; height=\&quot;180\&quot; as=\&quot;geometry\&quot;/&gt;&lt;/mxCell&gt;&lt;mxCell id=\&quot;RE9Lk4_TYkJp_x0fM5Pu-1\&quot; value=\&quot;&amp;lt;h1 style=&amp;quot;margin-top: 0px;&amp;quot;&amp;gt;Acceptance Criteria&amp;lt;/h1&amp;gt;&amp;lt;p&amp;gt;&amp;lt;/p&amp;gt;&amp;lt;ol&amp;gt;&amp;lt;li&amp;gt;The Console Use Case will support an &amp;quot;Alert&amp;quot; feature that writes a custom message to STDOUT and waits for a user to press the &amp;quot;ENTER&amp;quot; via STDIN before continuing.&amp;lt;/li&amp;gt;&amp;lt;li&amp;gt;The Console Use Case will support a &amp;quot;Confirm&amp;quot; feature that writes a custom message to STDOUT and wait for a user to answer a [y/N] prompt via STDIN before continuing. The return will be a Boolean true for any truthy confirmation.&amp;lt;/li&amp;gt;&amp;lt;li&amp;gt;The Console Use Case will support a &amp;quot;Choose&amp;quot; feature that presents an array of choices to STDOUT and waits for a user to select that choice via STDIN before continuing. The return will be an int representing the selected index. Invalid selections will re-prompt the choices for selection until a valid choice is made.&amp;lt;/li&amp;gt;&amp;lt;li&amp;gt;The Console Use Case will support a &amp;quot;Password&amp;quot; feature that writes a custom message to STDOUT and waits for a user to enter their password via STDIN reflecting none of the typed characters. The return will be a String of the entered password.&amp;lt;/li&amp;gt;&amp;lt;li&amp;gt;The Console Use Case will support a &amp;quot;Prompt&amp;quot; feature that writes a custom message to STDOUT and waits for a user to enter prompt via STDIN reflecting the typed characters. The return will be a String of the entered prompt.&amp;lt;/li&amp;gt;&amp;lt;li&amp;gt;The Console Use Case will support a &amp;quot;Write&amp;quot; feature that will write data to STDOUT without a newline character. Every call to this will continue to write data to STDOUT on the same line.&amp;lt;/li&amp;gt;&amp;lt;li&amp;gt;&amp;lt;span style=&amp;quot;background-color: transparent; color: light-dark(rgb(0, 0, 0), rgb(255, 255, 255));&amp;quot;&amp;gt;The Console Use Case will support a &amp;quot;WriteLn&amp;quot; feature that will write data to STDOUT with a newline character.&amp;lt;/span&amp;gt;&amp;lt;/li&amp;gt;&amp;lt;/ol&amp;gt;&amp;lt;p&amp;gt;&amp;lt;/p&amp;gt;\&quot; style=\&quot;text;html=1;whiteSpace=wrap;overflow=hidden;rounded=0;\&quot; vertex=\&quot;1\&quot; parent=\&quot;AeZsujJWKxi-5T-NB9ur-1\&quot;&gt;&lt;mxGeometry y=\&quot;171\&quot; width=\&quot;830\&quot; height=\&quot;269.5\&quot; as=\&quot;geometry\&quot;/&gt;&lt;/mxCell&gt;&lt;mxCell id=\&quot;H2LHGTzfXKt5BRG-AFjS-4\&quot; value=\&quot;&amp;lt;h1 style=&amp;quot;margin-top: 0px;&amp;quot;&amp;gt;Properties&amp;lt;/h1&amp;gt;&amp;lt;p&amp;gt;&amp;lt;/p&amp;gt;&amp;lt;ul&amp;gt;&amp;lt;li&amp;gt;None&amp;lt;/li&amp;gt;&amp;lt;/ul&amp;gt;&amp;lt;p&amp;gt;&amp;lt;/p&amp;gt;\&quot; style=\&quot;text;html=1;whiteSpace=wrap;overflow=hidden;rounded=0;\&quot; vertex=\&quot;1\&quot; parent=\&quot;AeZsujJWKxi-5T-NB9ur-1\&quot;&gt;&lt;mxGeometry x=\&quot;840\&quot; width=\&quot;254\&quot; height=\&quot;80\&quot; as=\&quot;geometry\&quot;/&gt;&lt;/mxCell&gt;&lt;mxCell id=\&quot;H2LHGTzfXKt5BRG-AFjS-6\&quot; value=\&quot;\&quot; style=\&quot;shape=mxgraph.mockup.markup.redX;fillColor=#ff0000;html=1;shadow=0;whiteSpace=wrap;strokeColor=none;\&quot; vertex=\&quot;1\&quot; parent=\&quot;AeZsujJWKxi-5T-NB9ur-1\&quot;&gt;&lt;mxGeometry x=\&quot;840\&quot; y=\&quot;130\&quot; width=\&quot;40\&quot; height=\&quot;30\&quot; as=\&quot;geometry\&quot;/&gt;&lt;/mxCell&gt;&lt;mxCell id=\&quot;H2LHGTzfXKt5BRG-AFjS-31\&quot; value=\&quot;Choices Flow\&quot; style=\&quot;swimlane;horizontal=0;whiteSpace=wrap;html=1;fillColor=#e3c800;fontColor=#000000;strokeColor=#B09500;\&quot; vertex=\&quot;1\&quot; parent=\&quot;AeZsujJWKxi-5T-NB9ur-1\&quot;&gt;&lt;mxGeometry x=\&quot;130\&quot; y=\&quot;450\&quot; width=\&quot;840\&quot; height=\&quot;187\&quot; as=\&quot;geometry\&quot;&gt;&lt;mxRectangle y=\&quot;503\&quot; width=\&quot;40\&quot; height ntStyle=1\&quot; parent=\&quot;s5lREBUkkn6SeKROCT2S-5\&quot; vertex=\&quot;1\&quot;&gt;&lt;mxGeometry y=\&quot;6\&quot; width=\&quot;1100\&quot; height=\&quot;40\&quot; as=\&quot;geometry\&quot;/&gt;&lt;/mxCell&gt;&lt;mxCell id=\&quot;s5lREBUkkn6SeKROCT2S-9\&quot; value=\&quot;9 / 16\&quot; style=\&quot;text;html=1;align=center;verticalAlign=middle;whiteSpace=wrap;rounded=0;fontStyle=1\&quot; parent=\&quot;s5lREBUkkn6SeKROCT2S-5\&quot; vertex=\&quot;1\&quot;&gt;&lt;mxGeometry x=\&quot;1022.3529411764706\&quot; y=\&quot;6\&quot; width=\&quot;77.64705882352942\&quot; height=\&quot;40\&quot; as=\&quot;geometry\&quot;/&gt;&lt;/mxCell&gt;&lt;mxCell id=\&quot;PYMKZs0pIxqd4BwRi7cy-0\&quot; value=\&quot;&amp;lt;h1 style=&amp;quot;margin-top: 0px;&amp;quot;&amp;gt;Description&amp;lt;/h1&amp;gt;&amp;lt;p&amp;gt;According to Wikipedia, &amp;quot;JSON (JavaScript Object Notation) is an open standard file format and data interchange format that uses human-readable text to store and transmit data objects consisting of namevalue pairs and arrays (or other serializable values). It is a commonly used data format with diverse uses in electronic data interchange, including that of web applications with servers.&amp;amp;nbsp;&amp;lt;span style=&amp;quot;background-color: transparent; color: light-dark(rgb(0, 0, 0), rgb(255, 255, 255));&amp;quot;&amp;gt;JSON is a language-independent data format. It was derived from JavaScript, but many modern programming languages include code to generate and parse JSON-format data. JSON filenames use the extension .json.&amp;quot;&amp;lt;/span&amp;gt;&amp;lt;/p&amp;gt;&amp;lt;p&amp;gt;&amp;lt;span style=&amp;quot;background-color: transparent; color: light-dark(rgb(0, 0, 0), rgb(255, 255, 255));&amp;quot;&amp;gt;For the purposes of the CodeMelted Dev project, the JSON Use Case will provide the functions necessary to facilitate working with the JSON format. This includes data validation, translating between supported data types, creating the SDK language JSON compliant format, parsing of strings to JSON, and stringifying the JSON object to a serialized JSON string.&amp;lt;/span&amp;gt;&amp;lt;/p&amp;gt;\&quot; style=\&quot;text;html=1;whiteSpace=wrap;overflow=hidden;rounded=0;\&quot; vertex=\&quot;1\&quot; parent=\&quot;s5lREBUkkn6SeKROCT2S-1\&quot;&gt;&lt;mxGeometry width=\&quot;830\&quot; height=\&quot;180\&quot; as=\&quot;geometry\&quot;/&gt;&lt;/mxCell&gt;&lt;mxCell id=\&quot;FzfowCu1-82XXkmBHmrd-0\&quot; value=\&quot;&amp;lt;h1 style=&amp;quot;margin-top: 0px;&amp;quot;&amp;gt;Acceptance Criteria&amp;lt;/h1&amp;gt;&amp;lt;p&amp;gt;&amp;lt;/p&amp;gt;&amp;lt;ol&amp;gt;&amp;lt;li&amp;gt;The JSON Use Case will support the translation of Strings to the appropriate JSON data types. Failure to perform such a translation will result in a NULL (whatever that means in the given SDK language).&amp;lt;/li&amp;gt;&amp;lt;li&amp;gt;The JSON Use Case will support the checking of variable data types to ensure that dynamic type data is as expected. This will support Boolean true / false returns along with the ability to throw an exception.&amp;lt;/li&amp;gt;&amp;lt;li&amp;gt;The JSON Use Case will support the creation on JSON compliant arrays and objects to support later JSON stringifying.&amp;lt;/li&amp;gt;&amp;lt;li&amp;gt;The JSON Use Case will support the ability to check a JSON object containing expected keys. This will support Boolean true / false returns along with the ability to throw an exception.&amp;lt;/li&amp;gt;&amp;lt;li&amp;gt;The JSON Use Case will support the parsing of a JSON string into a JSON compliant object. Failure to perform the parse will result in a NULL (whatever that means in the given SDK language).&amp;lt;/li&amp;gt;&amp;lt;li&amp;gt;The JSON Use Case will support the stringifying of a JSON compliant object to produce a JSON serialized string. Failure to perform the parse will result in a NULL (whatever that means in the given SDK language).&amp;lt;/li&amp;gt;&amp;lt;li&amp;gt;The JSON Use Case will support the validation of URL strings. This will support Boolean true / false returns along with the ability to throw an exception.&amp;lt;/li&amp;gt;&amp;lt;/ol&amp;gt;&amp;lt;p&amp;gt;&amp;lt;/p&amp;gt;\&quot; style=\&quot;text;html=1;whiteSpace=wrap;overflow=hidden;rounded=0;\&quot; vertex=\&quot;1\&quot; parent=\&quot;s5lREBUkkn6SeKROCT2S-1\&quot;&gt;&lt;mxGeometry y=\&quot;171\&quot; width=\&quot;830\&quot; height=\&quot;249\&quot; as=\&quot;geometry\&quot;/&gt;&lt;/mxCell&gt;&lt;mxCell id=\&quot;PnFSbyaIflcM8LG212ss-0\&quot; value=\&quot;&amp;lt;h1 style=&amp;quot;margin-top: 0px;&amp;quot;&amp;gt;Properties&amp;lt;/h1&amp;gt;&amp;lt;p&amp;gt;&amp;lt;/p&amp;gt;&amp;lt;ul&amp;gt;&amp;lt;li&amp;gt;None&amp;lt;/li&amp;gt;&amp;lt;/ul&amp;gt;&amp;lt;p&amp;gt;&amp;lt;/p&amp;gt;\&quot; style=\&quot;text;html=1;whiteSpace=wrap;overflow=hidden;rounded=0;\&quot; vertex=\&quot;1\&quot; parent=\&quot;s5lREBUkkn6SeKROCT2S-1\&quot;&gt;&lt;mxGeometry x=\&quot;840\&quot; width=\&quot;254\&quot; height=\&quot;80\&quot; as=\&quot;geometry\&quot;/&gt;&lt;/mxCell&gt;&lt;mxCell id=\&quot;PnFSbyaIflcM8LG212ss-1\&quot; value=\&quot;\&quot; style=\&quot;group\&quot; vertex=\&quot;1\&quot; connectable=\&quot;0\&quot; parent=\&quot;s5lREBUkkn6SeKROCT2S-1\&quot;&gt;&lt;mxGeometry x=\&quot;840\&quot; y=\&quot;90\&quot; width=\&quot;260\&quot; height=\&quot;81\&quot; as=\&quot;geometry\&quot;/&gt;&lt;/mxCell&gt;&lt;mxCell id=\&quot;PnFSbyaIflcM8LG212ss-2\&quot; value=\&quot;&amp;lt;h1 style=&amp;quot;margin-top: 0px;&amp;quot;&amp;gt;Applies To&amp;lt;/h1&amp;gt;&amp;lt;p&amp;gt;&amp;lt;br&amp;gt;&amp;lt;/p&amp;gt;\&quot; style=\&quot;text;html=1;whiteSpace=wrap;overflow=hidden;rounded=0;\&quot; vertex=\&quot;1\&quot; parent=\&quot;PnFSbyaIflcM8LG212ss-1\&quot;&gt;&lt;mxGeometry width=\&quot;260\&quot; height=\&quot;81\&quot; as=\&quot;geometry\&quot;/&gt;&lt;/mxCell&gt;&lt;mxCell id=\&quot;PnFSbyaIflcM8LG212ss-3\&quot; value=\&quot;\&quot; style=\&quot;shape=image;verticalLabelPosit 4472\&quot; as=\&quot;geometry\&quot;/&gt;&lt;/mxCell&gt;&lt;mxCell id=\&quot;NzH01cjH8mxeyRJHVsl9-8\&quot; value=\&quot;Logger Use Case\&quot; style=\&quot;text;html=1;align=center;verticalAlign=middle;whiteSpace=wrap;rounded=0;fontStyle=1\&quot; parent=\&quot;NzH01cjH8mxeyRJHVsl9-5\&quot; vertex=\&quot;1\&quot;&gt;&lt;mxGeometry y=\&quot;6\&quot; width=\&quot;1100\&quot; height=\&quot;40\&quot; as=\&quot;geometry\&quot;/&gt;&lt;/mxCell&gt;&lt;mxCell id=\&quot;NzH01cjH8mxeyRJHVsl9-9\&quot; value=\&quot;&amp;amp;nbsp;10 / 16\&quot; style=\&quot;text;html=1;align=center;verticalAlign=middle;whiteSpace=wrap;rounded=0;fontStyle=1\&quot; parent=\&quot;NzH01cjH8mxeyRJHVsl9-5\&quot; vertex=\&quot;1\&quot;&gt;&lt;mxGeometry x=\&quot;1022.3529411764706\&quot; y=\&quot;6\&quot; width=\&quot;77.64705882352942\&quot; height=\&quot;40\&quot; as=\&quot;geometry\&quot;/&gt;&lt;/mxCell&gt;&lt;mxCell id=\&quot;rWUH8tJt1tlrLcBDRpqs-0\&quot; value=\&quot;&amp;lt;h1 style=&amp;quot;margin-top: 0px;&amp;quot;&amp;gt;Description&amp;lt;/h1&amp;gt;&amp;lt;p&amp;gt;The most tried and true method of performing application diagnostics is logging. While Integrated Development Environments (IDEs) provide many tools to aid in development, logging captures what is happening within your application when a bug arises. And at the end of the day, bugs will always occur. To that end, the Logger Use Case represents a simple logging facility to STDOUT supporting four log levels. The four log levels are DEBUG, INFO, WARNING, and ERROR. The STDOUT logging can aid while the application is being developed. Additionally, the Logger Use Case will provide a logged event handler that allows expanding on this logging facility to attach other processing. This can be as simple as logging to file to logging events to log server. You can decide.&amp;lt;/p&amp;gt;\&quot; style=\&quot;text;html=1;whiteSpace=wrap;overflow=hidden;rounded=0;\&quot; vertex=\&quot;1\&quot; parent=\&quot;NzH01cjH8mxeyRJHVsl9-1\&quot;&gt;&lt;mxGeometry width=\&quot;830\&quot; height=\&quot;180\&quot; as=\&quot;geometry\&quot;/&gt;&lt;/mxCell&gt;&lt;mxCell id=\&quot;Rye-sW8nvq1UD98AyMC7-0\&quot; value=\&quot;&amp;lt;h1 style=&amp;quot;margin-top: 0px;&amp;quot;&amp;gt;Acceptance Criteria&amp;lt;/h1&amp;gt;&amp;lt;p&amp;gt;&amp;lt;/p&amp;gt;&amp;lt;ol&amp;gt;&amp;lt;li&amp;gt;The Logger Use Case will provide the ability to log to STDOUT supporting the logging levels of DEBUG, INFO, WARNING, and ERROR. The log format will be TIMESTAMP [LEVEL]: MESSAGE.&amp;lt;/li&amp;gt;&amp;lt;li&amp;gt;The Logger Use Case will support the setting of the given log level where logged events that don&#39;t meet that log level are not processed. It will also provide the ability to turn off the logging altogether.&amp;lt;/li&amp;gt;&amp;lt;li&amp;gt;The Logger Use Case will support the attaching of a Logged Event Handler to process logged events once they are logged to STDOUT.&amp;lt;/li&amp;gt;&amp;lt;/ol&amp;gt;&amp;lt;p&amp;gt;&amp;lt;/p&amp;gt;\&quot; style=\&quot;text;html=1;whiteSpace=wrap;overflow=hidden;rounded=0;\&quot; vertex=\&quot;1\&quot; parent=\&quot;NzH01cjH8mxeyRJHVsl9-1\&quot;&gt;&lt;mxGeometry y=\&quot;171\&quot; width=\&quot;830\&quot; height=\&quot;159\&quot; as=\&quot;geometry\&quot;/&gt;&lt;/mxCell&gt;&lt;mxCell id=\&quot;lg_kxv6Yp6shBbOLEH1A-0\&quot; value=\&quot;\&quot; style=\&quot;group\&quot; vertex=\&quot;1\&quot; connectable=\&quot;0\&quot; parent=\&quot;NzH01cjH8mxeyRJHVsl9-1\&quot;&gt;&lt;mxGeometry x=\&quot;840\&quot; y=\&quot;90\&quot; width=\&quot;260\&quot; height=\&quot;81\&quot; as=\&quot;geometry\&quot;/&gt;&lt;/mxCell&gt;&lt;mxCell id=\&quot;lg_kxv6Yp6shBbOLEH1A-1\&quot; value=\&quot;&amp;lt;h1 style=&amp;quot;margin-top: 0px;&amp;quot;&amp;gt;Applies To&amp;lt;/h1&amp;gt;&amp;lt;p&amp;gt;&amp;lt;br&amp;gt;&amp;lt;/p&amp;gt;\&quot; style=\&quot;text;html=1;whiteSpace=wrap;overflow=hidden;rounded=0;\&quot; vertex=\&quot;1\&quot; parent=\&quot;lg_kxv6Yp6shBbOLEH1A-0\&quot;&gt;&lt;mxGeo uot; value=\&quot;\&quot; style=\&quot;shape=image;verticalLabelPosition=bottom;labelBackgroundColor=default;verticalAlign=top;aspect=fixed;imageAspect=0;image=https://codemelted.com/assets/images/logo-codemelted-developer.png;\&quot; parent=\&quot;m-k2zEdf6-4-fsutIX5i-5\&quot; vertex=\&quot;1\&quot;&gt;&lt;mxGeometry x=\&quot;2.588235294117647\&quot; y=\&quot;6\&quot; width=\&quot;141.78861788617888\&quot; height=\&quot;35.44715447154472\&quot; as=\&quot;geometry\&quot;/&gt;&lt;/mxCell&gt;&lt;mxCell id=\&quot;m-k2zEdf6-4-fsutIX5i-8\&quot; value=\&quot;NPU Use Case\&quot; style=\&quot;text;html=1;align=center;verticalAlign=middle;whiteSpace=wrap;rounded=0;fontStyle=1\&quot; parent=\&quot;m-k2zEdf6-4-fsutIX5i-5\&quot; vertex=\&quot;1\&quot;&gt;&lt;mxGeometry y=\&quot;6\&quot; width=\&quot;1100\&quot; height=\&quot;40\&quot; as=\&quot;geometry\&quot;/&gt;&lt;/mxCell&gt;&lt;mxCell id=\&quot;m-k2zEdf6-4-fsutIX5i-9\&quot; value=\&quot;13 / 16\&quot; style=\&quot;text;html=1;align=center;verticalAlign=middle;whiteSpace=wrap;rounded=0;fontStyle=1\&quot; parent=\&quot;m-k2zEdf6-4-fsutIX5i-5\&quot; vertex=\&quot;1\&quot;&gt;&lt;mxGeometry x=\&quot;1022.3529411764706\&quot; y=\&quot;6\&quot; width=\&quot;77.64705882352942\&quot; height=\&quot;40\&quot; as=\&quot;geometry\&quot;/&gt;&lt;/mxCell&gt;&lt;mxCell id=\&quot;loqTmgMYE7K5NPby7jy--0\&quot; value=\&quot;&amp;lt;h1 style=&amp;quot;margin-top: 0px;&amp;quot;&amp;gt;Description&amp;lt;/h1&amp;gt;&amp;lt;p&amp;gt;According to Wikipedia, &amp;quot;A floating-point unit (FPU), numeric processing unit (NPU), colloquially math coprocessor, is a part of a computer system specially designed to carry out operations on floating-point numbers. Typical operations are addition, subtraction, multiplication, division, and square root.&amp;quot; The NPU Use Case will build upon this idea by setting up a collection of mathematical formulas for execution. These will range the gambit of typical formulas a developer may encounter. Furthermore, a compute capability will also exist to carry out complicated computations that involve more than a standard mathematical formula.&amp;lt;/p&amp;gt;\&quot; style=\&quot;text;html=1;whiteSpace=wrap;overflow=hidden;rounded=0;\&quot; vertex=\&quot;1\&quot; parent=\&quot;m-k2zEdf6-4-fsutIX5i-1\&quot;&gt;&lt;mxGeometry width=\&quot;830\&quot; height=\&quot;180\&quot; as=\&quot;geometry\&quot;/&gt;&lt;/mxCell&gt;&lt;mxCell id=\&quot;yD3C_wkM8PLFqXjdR2qQ-0\&quot; value=\&quot;&amp;lt;h1 style=&amp;quot;margin-top: 0px;&amp;quot;&amp;gt;Acceptance Criteria&amp;lt;/h1&amp;gt;&amp;lt;p&amp;gt;&amp;lt;/p&amp;gt;&amp;lt;ol&amp;gt;&amp;lt;li&amp;gt;The NPU Use Case will support the execution of mathematical formulas by providing a selection of said formula and passing the arguments necessary to complete the calculation. Mismatched arguments will result in an exception. Failed calculations (i.e. square of negative number, etc.) will result in a NAN return.&amp;lt;/li&amp;gt;&amp;lt;li&amp;gt;The NPU Use Case will support the ability to compute (i.e. series of computations) and return the result. The communication method of this capability will be JSON compliant data for both the request and result of the run. Unknown requests will be handled as an exception.&amp;lt;/li&amp;gt;&amp;lt;/ol&amp;gt;&amp;lt;p&amp;gt;&amp;lt;/p&amp;gt;\&quot; style=\&quot;text;html=1;whiteSpace=wrap;overflow=hidden;rounded=0;\&quot; vertex=\&quot;1\&quot; parent=\&quot;m-k2zEdf6-4-fsutIX5i-1\&quot;&gt;&lt;mxGeometry y=\&quot;171\&quot; width=\&quot;830\&quot; height=\&quot;139\&quot; as=\&quot;geometry\&quot;/&gt;&lt;/mxCell&gt;&lt;mxCell id=\&quot;7I2W5rNeMuu-_pgy6Yvf-0\&quot; value=\&quot;&amp;lt;h1 style=&amp;quot;margin-top: 0px;&amp;quot;&amp;gt;Properties&amp;lt;/h1&amp;gt;&amp;lt;p&amp;gt;&amp;lt;/p&amp;gt;&amp;lt;ul&amp;gt;&amp;lt;li&amp;gt;None&amp;lt;/li&amp;gt;&amp;lt;/ul&amp;gt;&amp;lt;p&amp;gt;&amp;lt;/p&amp;gt;\&quot; style=\&quot;text;html=1;whiteSpace=wrap;overflow=hidden;rounded=0;\
